// Code to print elements of a binary tree by level

// A utility function to print all nodes at a given level 
void printGivenLevel (struct node* root , int level) 
{ 
	if (root == NULL) 
		return; 
	if (level == 1) 
		printf("%d ", root->data); 
	else if (level > 1) 
	{ 
		printGivenLevel(root->left, level-1); 
		printGivenLevel(root->right, level-1); 
	} 
} 

// A function to do level order traversal of a tree 
void printLevelOrder(struct node* root) 
{ 
	int h = height(root); 
	int i; 
	for (i=1; i<=h; i++) 
		printGivenLevel(root, i); 
}

class MyStack { 
    int top; 
    int capacity; 
    int stack[]; 

    // Creating stack 
    MyStack(int capacity) 
    { 
        this.capacity = capacity; 
        stack = new int[capacity]; 
        top = -1; 
    } 

    // Adding an element on top of the stack  
    public void push(int item) 
    { 
        if (top == capacity - 1){ 
            System.out.println("Stack overflow"); 
        } 
        else{ 
            stack[++top] = item; 
            System.out.println(item + " pushed into stack"); 
        } 
    } 

    // Removing an element from the stack 
    public int pop() 
    { 
        if (top == -1) { 
            System.out.println("Stack underflow"); 
            return 0; 
        } 
        else { 
            int item = stack[top--]; 
            return item; 
        } 
    } 
}

